import React from 'react'
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import { useState } from 'react';


export const Register = () => {

    const [name, setName] = useState();
    const [lastname, setLastname] = useState();
    const [email, setEmail] = useState();
    const [password, setPassword] = useState();


    function submit() {
        let test = { name, lastname, email, password };
        console.warn(test);
    }

    return (



        <div>
            <div className="col-md-6 offset-sm-3 border shadow mt-20">
                <h1>Register Form</h1>
                <Form>
                    <input value={name} type="text" placeholder="Enter First Name" onChange={(e) => setName(e.target.value)} />
                    <input value={lastname} type="text" placeholder="Enter Last Name" onChange={(e) => setLastname(e.target.value)} />
                    <input value={email} type="email" placeholder="Enter email" onChange={(e) => setEmail(e.target.value)} />
                    <input value={password} type="password" placeholder="Password" onChange={(e) => setPassword(e.target.value)} />
                    <input className="text-muted" >
                        We'll never share your email And Password  with anyone else.
                    </input>
                    <Button variant="primary mb-3" type="submit" onClick={submit}>
                        Submit
                    </Button>
                </Form>
            </div>
        </div>
    )
}
